import React, { useState } from 'react';

function App() {
  const [pennies, setPennies] = useState(0);
  const [nickels, setNickels] = useState(0);
  const [dimes, setDimes] = useState(0);
  const [quarters, setQuarters] = useState(0);
  const [dollars, setDollars] = useState(0);
  const [fives, setFives] = useState(0);
  const [tens, setTens] = useState(0);
  const [twenties, setTwenties] = useState(0);
  const [fifties, setFifties] = useState(0);
  const [hundreds, setHundreds] = useState(0);

  // Calculate total cash count
  const total = (pennies * 0.01) + (nickels * 0.05) + (dimes * 0.10) + (quarters * 0.25) + dollars
    + (fives * 5) + (tens * 10) + (twenties * 20) + (fifties * 50) + (hundreds * 100);

  return (
    <div>
      <h1>Cash Counting App</h1>
      <div>
        <label>Pennies:</label>
        <input type="number" value={pennies} onChange={(e) => setPennies(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Nickels:</label>
        <input type="number" value={nickels} onChange={(e) => setNickels(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Dimes:</label>
        <input type="number" value={dimes} onChange={(e) => setDimes(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Quarters:</label>
        <input type="number" value={quarters} onChange={(e) => setQuarters(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Ones:</label>
        <input type="number" value={dollars} onChange={(e) => setDollars(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Fives:</label>
        <input type="number" value={fives} onChange={(e) => setFives(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Tens:</label>
        <input type="number" value={tens} onChange={(e) => setTens(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Twenties:</label>
        <input type="number" value={twenties} onChange={(e) => setFives(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Fifties:</label>
        <input type="number" value={fifies} onChange={(e) => setFives(parseInt(e.target.value))} />
      </div>
      <div>
        <label>Hundreds:</label>
        <input type="number" value={fives} onChange={(e) => setFives(parseInt(e.target.value))} />
      </div>
      {/* Add similar input fields for other denominations */}
      <div>
        <h2>Total: ${total.toFixed(2)}</h2>
      </div>
    </div>
  );
}

export default App;
